import{clearMsg}from"../../../../../../core/utils/dom/messages.js";export function setActiveTab({evt:e,msgElement:t}){clearMsg({container:t});const r=document.getElementById("tab-container").querySelectorAll('[id$="-tab"]');Array.from(r).forEach((t=>{t.id===e.target.id?t.nextElementSibling.classList.add("w3-blue-grey"):t.nextElementSibling.classList.remove("w3-blue-grey")}))}